import {Link} from "react-router-dom";
import './CompanyCard.css';
import Paper from '@mui/material/Paper'

export default function CompanyCard({companies}) {

    return (
        <>
            {companies.map(c => (
                <Paper elevation={5} >
                    <Link className="CompanyCard" key={crypto.randomUUID()} to={`/companies/${c.handle}`}>
                        <div>
                            <h2>{c.name}</h2>
                            <p>{c.description}</p>
                        </div>
                    </Link>
                </Paper>

            ))}
        </>
    )
}
